    "historical-shoreline-for-new-jersey-1971-to-1978-vector-digital-data",nt"isopen":
    false,nt"url": null,nt"notes": "New_Jersey_1971_78_Digitized_Shoreline.zip
    features a digitized historic shoreline for the New Jersey coastline (Point Pleasant,
    NJ to Longport, NJ) from 1971 to 1978. Imagery of the New Jersey coastline was acquired
    from the New Jersey Geographic Information Network (NJGIN) as two images: u201c1970
    NJDEP Wetlands Basemapu201d (1971-78) and the u201c1977 Tidelands Basemapsu201d
    (1977-78). These images are available as a web mapping service (WMS) through the
    NJGIN website (https://njgin.state.nj.us/NJ_NJGINExplorer/jviewer.jsp?pg=wms_instruct).
    To reduce digitizing error, the imagery was acquired on a hard drive from the NJGIN
    via personal communication. Using ArcMap 10.3.1, the "1970 NJDEP Wetlands Basemap"
    was used to delineate and digitize historical foreshore, backshore, mainland, and
    island shoreline positions, with the u201c1977 Tidelands Basemapsu201d being used
    to fill in missing shorelines and clarify areas of uncertainty from the 1970s imagery.
    These shorelines were digitized for use in long-term shoreline and wetland analyses
    for Hurricane Sandy wetland physical change assessment.",nt"license_title":
